<template>
  <div
    :style="{
      'background-color': dynamicBgColor,
      transition: '0.5s',
    }"
    class="w-100 m-auto pt-5 pb-5"
  >
    <h1
      class="display-3 munich w-50 m-auto border-dark border-top text-center pt-5"
    >
      Last Viewed
    </h1>
    <CRow class="w-50 m-auto">
      <CCol
        v-for="item in dbData"
        :key="item.id"
        class="col-sm-4 col-12 p-lg-5 p-3"
      >
        <router-link
          :to="{
            name: 'GalleryItem',
            params: {
              id: item.id,
            },
          }"
        >
          <img
            @mouseover="getImage"
            :alt="item.name"
            class="w-100 rounded cursor-pointer"
            :src="item.src"
          />
        </router-link>
      </CCol>
    </CRow>
  </div>
</template>
<script>
export default {
  name: 'LastViewed',
  data() {
    const dbData = [
      {
        id: 1,
        name: 'image1',
        src: 'data:image/jpeg;base64,',
      },
      {
        id: 2,
        name: 'image2',
        src: 'data:image/jpeg;base64,',
      },
      {
        id: 3,
        name: 'image3',
        src: 'data:image/jpeg;base64,',
      },
    ]
    const dynamicBgColor = null
    return {
      dbData,
      dynamicBgColor,
    }
  },
  methods: {
    getAverageRGB: function (imgEl) {
      var blockSize = 5, // only visit every 5 pixels
        defaultRGB = { r: 0, g: 0, b: 0 }, // for non-supporting envs
        canvas = document.createElement('canvas'),
        context = canvas.getContext && canvas.getContext('2d'),
        data,
        width,
        height,
        i = -4,
        length,
        rgb = { r: 0, g: 0, b: 0 },
        count = 0

      if (!context) {
        return defaultRGB
      }

      height = canvas.height =
        imgEl.naturalHeight || imgEl.offsetHeight || imgEl.height
      width = canvas.width =
        imgEl.naturalWidth || imgEl.offsetWidth || imgEl.width

      context.drawImage(imgEl, 0, 0)

      try {
        data = context.getImageData(0, 0, width, height)
      } catch (e) {
        /* security error, img on diff domain */
        return defaultRGB
      }

      length = data.data.length

      while ((i += blockSize * 4) < length) {
        ++count
        rgb.r += data.data[i]
        rgb.g += data.data[i + 1]
        rgb.b += data.data[i + 2]
      }

      // ~~ used to floor values
      rgb.r = ~~(rgb.r / count)
      rgb.g = ~~(rgb.g / count)
      rgb.b = ~~(rgb.b / count)

      this.dynamicBgColor = `rgb(${rgb.r}, ${rgb.g}, ${rgb.b})`
    },
    getImage: function (el) {
      this.getAverageRGB(el.target)
    },
  },
  beforeMount() {
    //dbData will be edited here
  },
}
</script>
